DROP TABLE IF EXISTS `lake_larke_auth_rule`;
CREATE TABLE `lake_larke_auth_rule` (
  `id` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '规则id',
  `parentid` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '上级分类ID',
  `title` char(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '规则中文描述',
  `name` char(80) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '规则唯一英文标识',
  `parameter` char(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '附加参数',
  `fields` text COLLATE utf8mb4_unicode_ci COMMENT '扩展权限字段',
  `condition` varchar(300) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '规则附加条件',
