  `tip` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '提示',
  `type` tinyint(2) DEFAULT '1' COMMENT '1-url;2-主菜单',
  `listorder` smallint(5) NOT NULL DEFAULT '100' COMMENT '排序ID',
